import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import axios from 'axios';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <div className="container">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/recent" element={<RecentChecks />} />
          </Routes>
        </div>
        <Footer />
      </div>
    </Router>
  );
}

function Navbar() {
  return (
    <nav className="navbar">
      <div className="container">
        <Link to="/" className="brand">PHISHING DETECTOR</Link>
        <div className="nav-links">
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/contact">Contact</Link>
          <Link to="/recent">Recent Checks</Link>
        </div>
      </div>
    </nav>
  );
}

function Home() {
  const [url, setUrl] = useState('');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const checkUrl = async (e) => {
    e.preventDefault();
    if (!url) {
      setError('Please enter a URL to check');
      return;
    }

    setLoading(true);
    setError(null);

    try {
      const response = await axios.post('http://localhost:5000/check', { url });

      if (response.data.error) {
        throw new Error(response.data.error);
      }

      setResult(response.data);

      const recent = JSON.parse(localStorage.getItem('recentChecks') || '[]');
      localStorage.setItem(
        'recentChecks',
        JSON.stringify([response.data, ...recent.filter(r => r.url !== response.data.url)].slice(0, 10))
      );

    } catch (err) {
      console.error("Error checking URL:", err);
      setError(err.response?.data?.error || err.message || 'Failed to check URL. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="home">
      <h1>Phishing URL Detection</h1>
      <div className="card">
        <form onSubmit={checkUrl} className="url-form">
          <input
            type="url"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            placeholder="Enter URL (e.g., https://example.com)"
            required
          />
          <button type="submit" disabled={loading}>
            {loading ? (
              <><span className="spinner"></span> Checking...</>
            ) : (
              'Check URL'
            )}
          </button>
        </form>

        {error && <div className="error">{error}</div>}

        {result && (
          <div className="result">
            <h3>Analysis Result</h3>
            <p>
              URL: <a href={result.url} target="_blank" rel="noopener noreferrer">{result.url}</a>
            </p>
            <div className={`status ${result.is_phishing ? 'phishing' : 'safe'}`}>
              {result.is_phishing ? '⚠️ PHISHING DETECTED' : '✅ SAFE WEBSITE'}
            </div>
            <div className="risk-level">
              <span>Risk Level:</span>
              <div className="progress-bar">
                <div
                  className="progress"
                  style={{ width: `${Math.round(result.probability * 100)}%` }}
                >
                  {Math.round(result.probability * 100)}%
                </div>
              </div>
            </div>
            <p className="timestamp">Checked on: {result.timestamp}</p>
            {result.is_phishing && (
              <div className="warning">
                <p>⚠️ Warning: This website appears to be a phishing attempt.</p>
                <p>Do not enter any personal or sensitive information.</p>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
}

function About() {
  return (
    <div className="page">
      <h2>About Us</h2>
      <p>
        This Phishing Detection System is designed to help users quickly and reliably verify the legitimacy of any URL. The system uses a machine learning model trained on multiple features including the structure of the URL, presence of suspicious keywords, WHOIS data, and more. It flags potentially dangerous URLs, especially those attempting to imitate legitimate services through IP-based URLs, typo abuse (e.g., yah00 instead of yahoo), subdomain tricks, and keyword manipulation.
      </p>
      <p>
        Our goal is to increase awareness and reduce the risk of phishing attacks by providing a real-time, accurate URL analysis tool. Whether you're an individual, an organization, or a developer, you can integrate or use our system to stay protected.
      </p>
    </div>
  );
}

function Contact() {
  return (
    <div className="page">
      <h2>Contact Us</h2>
      <p>Email: <a href="mailto:rtuyi883@gmail.com">rtuyi883@gmail.com</a></p>
      <p>Phone: <a href="tel:+250789246013">+250789246013</a></p>
    </div>
  );
}

function RecentChecks() {
  const recent = JSON.parse(localStorage.getItem('recentChecks') || '[]');

  return (
    <div className="page">
      <h2>Recent Checks</h2>
      {recent.length === 0 ? (
        <p>No recent checks available.</p>
      ) : (
        <table className="recent-table">
          <thead>
            <tr>
              <th>Status</th>
              <th>URL</th>
              <th>Checked On</th>
            </tr>
          </thead>
          <tbody>
            {recent.map((item, index) => (
              <tr key={index} className={item.is_phishing ? 'phishing' : 'safe'}>
                <td>{item.is_phishing ? 'Phishing' : 'Safe'}</td>
                <td><a href={item.url} target="_blank" rel="noreferrer">{item.url}</a></td>
                <td>{item.timestamp}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

function Footer() {
  return (
    <footer className="footer">
      <p>&copy; 2025 Designed by RACHEL</p>
    </footer>
  );
}

export default App;
